import useHook  from 'react';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

const Work = () => {
  return (
    <>
    <div className='work-page'>

        <Container fluid>
          <Row>
            <Col>1 of 1</Col>
          </Row>
        </Container>
    </div>
    </>
  )
}

export default Work;
